import React, { Component, Fragment } from 'react';
import { ChevronDown } from 'react-bootstrap-icons';

class NavMenu extends Component {


    // onMenuClickHandler = () => {
    //   this.setState({
    //     hideDropdown: false
    //   })
    // }

    render () {
        return ( 
          <Fragment>
            <div className='static group'>
              <div className="
                flex flex-row
                px-2 py-1 mb-1 
                font-display 
                text-blue-primary font-normal text-md 
                group-hover:bg-mustard cursor-pointer"
                // onClick={() => this.onMenuClickHandler}
              >
                <span className="group-hover:text-white">
                  {this.props.title}
                </span>
                <ChevronDown size={12} className="ml-1 mt-2 font-bold text-mustard group-hover:text-white"/>
              </div>
              {/* <div className='absolute'>
                  testfd
              </div> */}
            </div>
          </Fragment>
        );
    }
}

export default NavMenu;
